import React from 'react';
import classes from './Header.module.css';
import Classes from './Header.module.css';
const Header = () => {
    return(
        <header className={classes.header}>
        <img src='https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Logo_TV_2015.svg/800px-Logo_TV_2015.svg.png' />
      

         <a className={classes.item}>HOME</a> <a className="item">MESSAGES</a> <a className="item">NEWS</a> <a className="item">MUSIC</a> <a className="item">SETTINGS</a>
      </header>
    )
}

export default Header;
